import React from 'react';
import './About.css';

const About = () => {
  return (
    <section id="about" className="about">
      <h2>À propos de moi</h2>
      <p>Je suis passionnée par la beauté, la mode, la technologie et l'astrophysique...</p>
    </section>
  );
}

export default About;
